Straight out of Australia 🇦🇺 to California, Daniel Twigden is a metal shaping and fabrication instructor at Manteca Adult School. He has been around shaping forever and has taken the trip with Baileigh from the early days. Now he lives out his passion in the Bound For Flames Chopper Class #baileigharmy #baileighbiography #baileighmetalshaping #baileightubebender #baileighbrake 
