Cody Swinehart from @quarter_tilt_metal_co in Petaluma, California is another successful product of Baileigh’s social media prowess. He was still wet behind the ears when he wandered into our showroom nearly a decade ago. I personally stood and chewed the rag with Cody for several hours before selling him his first #baileighbeadroller 👌 He had a ton of grandiose plans and a drive that you don’t see in many young fabricators. I knew he was going places and helped him grow his business on social media the best I could. He became one of our first #magneticbrake rock stars, providing a portfolio of some of the coolest custom bent pieces we have ever seen. Several #baileighmetalshaping machines later, Cody found himself surrounded by our machinery. Finally, it was the addition of his BP-3305 #baileighpressbrake that launched him into the #baileigharmy archives with a ton of killer custom bent bumpers and off road accessories. He’s a cool cat with a heart of gold and deserves a follow. Go smash that follow button #baileighbiography #baileighshrinkerstretcher 
