The English Wheel squeezes sheet metal between two anvils (rollers) stretching and shaping the material (similar to that rolling pin on Grandma’s pie crust) 👌 This allows @sarah_stork_ to manipulate the sheet metal to her will, creating beautiful metal art sculptures. #baileighramy 
@sarah_stork_ 
@sarah_stork_ 
@sarah_stork_

Troy Ladd leads the incredibly talented group of coach builders, fabricators, metal shapers and hot rod visionaries at @hollywood_hot_rods 👌 Troy has been involved with #baileighmetalshaping for a long time.... in fact, I personally sold him his first #baileighplanishinghammer over a decade ago 😉 He has used our machinery to win some of the most prestigious awards in the industry. The 1936 Packard Roadster named the #mullhollandspeedster won America's Most Beautiful Roadster (AMBR) at the @grandnationalroadstershow in 2017.  It’s unbelievable contours, reverse curves and retractable roof set it apart and raised the bar in design and metal shaping. The PH-28HD #baileighpowerhammer BB-4816M #magneticbrake and MSS-16F #baileighshrinkerstretcher have been instrumental in his growth.......both as a business owner and an artist. Go smash that follow button and watch this iconic group of metal shapers continue to innovate while still respecting tradition 👊😎 
